import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './OrderManagement.css';

interface Order {
  _id: string;
  customerName: string;
  orderId: string;
  date: string;
  estimatedDeliveryDate: string;
}

const OrderManagement: React.FC = () => {
  const navigate = useNavigate();
  const [orders, setOrders] = useState<Order[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        navigate('/login');
        return;
      }

      const response = await fetch('http://localhost:5001/api/orders', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.status === 401) {
        navigate('/login');
        return;
      }

      if (response.status === 403) {
        setError('Access denied. Admin privileges required.');
        setLoading(false);
        return;
      }

      if (!response.ok) {
        throw new Error('Failed to fetch orders');
      }

      const data = await response.json();
      setOrders(data);
      setLoading(false);
    } catch (err) {
      setError('Error fetching orders');
      setLoading(false);
      console.error('Error:', err);
    }
  };

  const handleSignOut = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleEdit = async (id: string, field: keyof Order, value: string) => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        navigate('/login');
        return;
      }

      const response = await fetch(`http://localhost:5001/api/orders/${id}`, {
        method: 'PATCH',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ [field]: value })
      });

      if (response.status === 401) {
        navigate('/login');
        return;
      }

      if (!response.ok) {
        throw new Error('Failed to update order');
      }

      setOrders(orders.map(order => 
        order._id === id ? { ...order, [field]: value } : order
      ));
    } catch (err) {
      console.error('Error updating order:', err);
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="order-management">
      <header>
        <nav>
          <a href="/">Home</a>
          <a href="/gallery">Gallery</a>
          <a href="/orders">Orders</a>
          <a href="/contact">Contact</a>
        </nav>
        <button className="sign-out-btn" onClick={handleSignOut}>
          Sign Out
        </button>
      </header>

      <h2>Order Management</h2>

      <div className="table-container">
        <table>
          <thead>
            <tr>
              <th>Serial Number</th>
              <th>Customer Name</th>
              <th>Order ID</th>
              <th>Date</th>
              <th>Estimated Delivery Date</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((order, index) => (
              <tr key={order._id}>
                <td>{index + 1}</td>
                <td
                  contentEditable
                  onBlur={(e) => handleEdit(order._id, 'customerName', e.currentTarget.textContent || '')}
                >
                  {order.customerName}
                </td>
                <td
                  contentEditable
                  onBlur={(e) => handleEdit(order._id, 'orderId', e.currentTarget.textContent || '')}
                >
                  {order.orderId}
                </td>
                <td
                  contentEditable
                  onBlur={(e) => handleEdit(order._id, 'date', e.currentTarget.textContent || '')}
                >
                  {order.date}
                </td>
                <td
                  contentEditable
                  onBlur={(e) => handleEdit(order._id, 'estimatedDeliveryDate', e.currentTarget.textContent || '')}
                >
                  {order.estimatedDeliveryDate}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default OrderManagement;
